import React from 'react';
import { useSelector } from 'react-redux';


export default function Pokemons (){
    let pokemons = useSelector((state)=> state.loadedPokemons);     
    console.log(pokemons);

    return(
        <div>
            <h4>    
            Soy el component Pokemons
            </h4>
        </div>
    )
}
